  false,\n\t\"url\": null,\n\t\"notes\": \"The Medicaid Buy-In Program for Working
  People with Disabilities offers people with disabilities who are working, and earning
  more than the allowable limits for regular Medicaid, the opportunity to keep their
  health care coverage through Medicaid. Eligibility requirements include certain
  criteria and income levels as listed here. This chart is only a guide. Individuals
  should see an enrollment counselor for eligibility screening. NOTE: Chart effective
  January 1, 2012; subject to annual income updates.\",\n\t\"license_title\": \"License
